DROP TABLE IF EXISTS `cas`;

CREATE TABLE `cas` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `nis` varchar(10) COLLATE latin1_general_ci DEFAULT NULL,
  `semester` bigint(20) DEFAULT NULL,
  `sakit` bigint(20) DEFAULT NULL,
  `izin` bigint(20) DEFAULT NULL,
  `alpha` bigint(20) DEFAULT NULL,
  `catatan` text COLLATE latin1_general_ci,
  `tanggapanortu` text COLLATE latin1_general_ci NOT NULL,
  `pernyataan` text COLLATE latin1_general_ci,
  `mode_kenaikan_kelas` varchar(250) COLLATE latin1_general_ci NOT NULL DEFAULT 'OTOMATIS',
  `kenaikan_kelas` text COLLATE latin1_general_ci,
  `sdudi` text COLLATE latin1_general_ci NOT NULL,
  `spengembangan` text COLLATE latin1_general_ci NOT NULL,
  `sprestasi` text COLLATE latin1_general_ci NOT NULL,
  `keputusan` varchar(15) COLLATE latin1_general_ci NOT NULL,
  `catatan_mapel` text COLLATE latin1_general_ci NOT NULL,
  `created_by` varchar(30) COLLATE latin1_general_ci NOT NULL,
  `created_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modified_by` varchar(30) COLLATE latin1_general_ci NOT NULL,
  `modified_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `nis_idx` (`nis`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;




DROP TABLE IF EXISTS `ekskul`;

CREATE TABLE `ekskul` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `ekskul` varchar(120) NOT NULL,
  `deskripsi` text NOT NULL,
  `created_by` varchar(30) NOT NULL,
  `created_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modified_by` varchar(30) NOT NULL,
  `modified_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ekskul` (`ekskul`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `guru`;

CREATE TABLE `guru` (
  `kode` bigint(20) NOT NULL AUTO_INCREMENT,
  `nama` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `nip` varchar(20) COLLATE latin1_general_ci DEFAULT NULL,
