 INSERT INTO `matapelajaran`(kode,nama,jenis,kkm,kbp1,kbk1,desp1,desk1,jp1,jk1,kbp2,kbk2,desp2,desk2,jp2,jk2,kbp3,kbk3,desp3,desk3,jp3,jk3,kbp4,kbk4,desp4,desk4,jp4,jk4,kbp5,kbk5,desp5,desk5,jp5,jk5,kbp6,kbk6,desp6,desk6,jp6,jk6,created_by,created_time,modified_by,modified_time,jp1a,jp2a,jp3a,jp4a,jp5a,jp6a,jk1a,jk2a,jk3a,jk4a,jk5a,jk6a,desp21,desp22,desp23,desp24,desp25,desp26,desk21,desk22,desk23,desk24,desk25,desk26)  VALUES 
  ("A01","Pendidikan Agama Islam dan Budi Pekerti","Kelompok A (Umum)","0","75","75","Menganalisis Q.S. Al Hujurat/49 : 10 dan 12 serta hadits tentang ontrol diri, prasangka baik dan persaudaraan, larangan pergaulan bebas dan perbuatan zina; menganalisis makna 7 Asmaul Husna; makna beriman kepada malaikat, ketentuan berpakaian sesuai syariat.","Terampil Membaca dan mendemonstrasikan Q.S. Al Hujurat/49 : 10 dan 12 serta hadits tentang ontrol diri, prasangka baik dan persaudaraan, larangan pergaulan bebas dan perbuatan zina; menganalisis makna 7 Asmaul Husna; makna beriman kepada malaikat, ketentuan berpakaian sesuai syariat.","6","6","75","75","Menganalisis semangat keilmuan,kedudukan Al Qur`an, Hadits dan ijtihad sebagai sumber hukum Islam, hikmah ibadah haji, zakat dan wakaf bgi individu dan masyarakat, menganalisis substansi, strategi dan penyebab keberhasilan dakwah Nabi Muhammad di Makkah dan Madinah.","Menyajikan kaitan antara kewajiban menuntut ilmu dengan kewajiban membela agama sesuai perintah Q.S. At Taubah/9 :122 dan hadits terkait; mendeskripsikan macam-macam sumber hukum Islam; menyimulasikan ibadah haji, zakat dan wakaf; menyajikan keterkaitan antara substansi dan  strategi dengan keberhasilan dakwah Nabi Muhammad saw di Makkah dan Madinah.","5","5","75","75","Memahami makna taat kepada aturan, bekerja keras, makna iman kepada kitab dan rasul-rasul Allah SWT, makna toleransi dan kerukunan, bahaya perilaku tindak kekerasan, menelaah prinsip dan praktik ekonomi dalam Islam.","Membaca dan menghafal QS.Al-Maidah:48, QS.Az-Zumar:39 QS.At-Taubah:105 dan hadits yang terkait, membuat makalah tentang perilaku toleransi dan kerukunan, membuat laporan prinsip-prinsip dan praktik ekonomi dalam Islam.","3","3","75","75","Memahami pelaksanaan tata cara penyelenggaraan jenazah, pelaksanaan khutbah, tabligh dan dakwah,menelaah perkembangan peradaban Islam pada masa kejayaan,menelaah perkembangan Islam pada masa modern (1800-sekarang).","Praktik shalat jenazah,membuat teks khutbah jumat dan praktiknya bagi  laki-laki dan ceramah/pidato bagi perempuan,membuat makalah tentang perkembangan peradaban Islam pada masa kejayaan,membuat makalah tentang perkembangan peradaban Islam pada masa modern.","4","4","75","75","Menganalisis QS. Ali Imran:159, 190-191, serta hadits tetang berfikir kritis dan bersikap demokratis, menganalisis Qs. Lukman: 13-14, Al-Baqarah: 83 serta hadits tentang saling nasihat menasihati dan berbuat baik. Memahami makna beriman kepada hari akhir serta qadha qadar.","Membaca QS,Ali Imran : 159, 190-191,Qs. Lukman: 13-14 Qs. Al-Baqarah: 83 sesuai dengan kaidah tajwid serta makharijul huruf . Berperilaku yang mencerminkan kesadaran berimaan kepada hari akhir serta qadha dan qadar.","6","6","75","75","Memahami ketentuan pernikahan dan waris dalam Islam, memahami strategi dakwah dan perkembangan Islam di Indonesia serta menganalisis faktor-faktor kemajuan  dan kemunduran peradaban Islam di Dunia","Mempraktikkan pelaksanaan pernikahan dan pembagian waris dalam Islam, mendeskripsikan strategi dakwah dan perkembangan Islam di Indonesia, serta faktor-faktor kemajuan dan kemunduran peradaban Islam di dunia","6","6","","0000-00-00 00:00:00","admin","0000-00-00 00:00:00","6","5","3","4","6","6","6","5","3","4","6","6","Memahami ayat Al Qur`an pilihan dan pakaian sesuai syariat islam","Menganalisis Kedudukan AlQuran , hadis dan Itihad sebagai sumber hukum, ","Memahami makna taat kepada aturan, bekerja keras, makna iman kepada kitab dan rasul-rasul Allah SWT.","Memahami pelaksanaan tata cara penyelenggaraan jenazah dan menelaah perkembangan peradaban Islam pada masa kejayaan,menelaah perkembangan Islam pada masa modern (1800-sekarang)","Memahami ayat Al Qur`an pilihan dan tanda hari akhir","Memahami ketentuan, syarat dan rukun pernikahan dan mawaris","Membaca ayat Al Quran pilihan","Menganalisis Semangat Keilmuan","Membaca QS.Al-Maidah:48, QS.Az-Zumar:39 QS.At-Taubah:105 dan hadits yang terkait.","Praktik shalat jenazah, membuat makalah tentang perkembangan peradaban Islam pada masa kejayaan","Membaca ayat Al Quran pilihan","Mempraktikan pelaksanaan pernikahan dan pembagian mawaris ");
 INSERT INTO `matapelajaran`(kode,nama,jenis,kkm,kbp1,kbk1,desp1,desk1,jp1,jk1,kbp2,kbk2,desp2,desk2,jp2,jk2,kbp3,kbk3,desp3,desk3,jp3,jk3,kbp4,kbk4,desp4,desk4,jp4,jk4,kbp5,kbk5,desp5,desk5,jp5,jk5,kbp6,kbk6,desp6,desk6,jp6,jk6,created_by,created_time,modified_by,modified_time,jp1a,jp2a,jp3a,jp4a,jp5a,jp6a,jk1a,jk2a,jk3a,jk4a,jk5a,jk6a,desp21,desp22,desp23,desp24,desp25,desp26,desk21,desk22,desk23,desk24,desk25,desk26)  VALUES 
  ("A02","Pendidikan Agama Katolik  dan Budi Pekerti","Kelompok A (Umum)","0","75","75","1.1 Menyatakan syukur kepada Allah atas keunikan, kemampuan, dan keterbatasan diri melalui ungkapan-ungkapan yang tertuang dalam jurnal introspeksi.\n\n1.2 Menyatakan tanggung jawab dalam menerima segala keunikan, kemampuan, dan keterbatasan diri melalui ungkapan-ungkapan yang tertuang dalam jurnal introspeksi.\n\n1.3 Menginventarisasi keunikan, kemampuan, dan keterbatasan diri.","1.1 Menyusun puisi/syair/lirik akan kemampuan dan keterbatasannya diri.\n \n1.2  Menyusun jurnal introspeksi mengenai keunikan, kemampuan, dan keterbatasannya diri.\n\n1.3 Menampilkan jurnal introspeksi dalam bentuk simbol diri tentang keunikan, kemampuan, dan keterbatasannya diri.","5","5","75","75","2.1 Menyatakan\nkepercayaan bahwa\nYesus Kristus yang\ndatang untuk\nmewartakan dan\nmemperjuangkan\nKerajaan Allah.\n\n2.2 Menyatakan sikap\nkepercayaannya Yesus\nKristus yang datang\nuntuk mewartakan\ndan memperjuangkan\nKerajaan Allah\nmelalui jurnal\nintrospeksi.\n\n2.3 Mengikuti\nadorasi Sakramen\nMahakudus\nuntuk menghayati\nsengsara, wafat, dan\nkebangkitan Yesus","2.1 Merumuskan\nkesimpulan yang\nberisi gagasan\npenting yang\nditemukan mengenai\npaham Kerajaan Allah\nyang diwartakan\nYesus.\n\n2.2 Menyajikan/\nmempresentasikan\ninfografis tentang\ngagasan penting\nberkaitan dengan\npemahaman\nakan Yesus yang\nmewartakan Kerajaan\nmelalui kata dan\nperbuatan.\n\n2.3 Menuliskan doa\nakan makna\nsengsara, wafat, dan\nkebangkitan Yesus\nbagi kehidupan\nmanusia zaman\nsekarang yang\ndidoakan secara\npribadi pada saat\nadorasi Sakramen\nMahakudus","5","5","75","75","1.1 Menyatakan syukur kepada Allah yang menganugerahkan Gereja sebagai umat Allah.\n\n1.2 Menyatakan tanggung jawab sebagai anggota Gereja yang merupakan umat Allah.\n\n1.3 Menjelaskan arti Gereja sebagai umat Allah (LG 4,7,9).","1.1 Menyebutkan ciri-ciri Gereja sebagai umat Allah (LG 4,7,9).\n\n1.2 Menjelaskan arti Gereja menurut Kitab Suci (Kis. 2: 41-47).\n\n1.3 Menjelaskan konsekuensi Gereja sebagai umat Allah dalam hidup menggereja dewasa ini.","5","5","75","75","4.1 Menyatakan iman\npada Yesus Kristus\ndalam tugas\npokok Gereja yaitu\nmenguduskan dunia\nsesuai peran dalam\nhidup sehari-hari\n\n4.2 Menyatakan rasa\nsyukur atas hubungan\nantara Gereja dan\ndunia sehingga\ndapat terlibat dalam\nkegembiraan dan\nkeprihatinan dunia\n\n4.3 Menyatakan rasa\nsyukur atas hubungan\nantara Gereja dan\ndunia","4.1 Menuliskan refleksi\ntentang keterlibatan\ndiri dalam tugas\npokok Gereja yang\nmenguduskan sesuai\ndengan kedudukan\ndan peranannya\nsebagai murid Yesus\nKristus.\n\n4.2 Menuliskan sebuah\nrefleksi tentang\nhubungan Gereja\ndengan dunia agar\ndapat terlibat dalam\nkegembiraan dan\nkeprihatinan dunia\n\n4.3 Menuliskan sebuah\nrefleksi tentang\nhubungan Gereja\ndengan dunia","5","5","75","75","1.1 Menyatakan syukur kepada Tuhan bahwa hakikat keluarga merupakan panggilan hidup.\n\n1.2 Menyatakan tanggung jawab dalam hidup bersama seluruh anggota keluarga\n\n1.3 Menjelaskan pemahaman umum (tentang keluarga menurut pandangan umum).","2.1 Menjelaskan makna keluarga sebagai panggilan (Gaudium et Spes art. 52).\n\n2.2 Menjelaskan arti pentingnya komunikasi dalam keluarga.\n\n2.3 Menuliskan refleksi tentang panggilan hidup berkeluarga.","5","5","75","75","6.1 Menyatakan syukur\natas adanya kekhasan\nagama-agama dan\nkepercayaan lain di\nIndonesia\n\n6.2 Menyatakan syukur\natas semangat\ndialog dengan umat\nberagama dan aliran\nkepercayaan lain\n\n6.3 Menyatakan syukur\natas adanya semangat\npersaudaraan\nsejati melalui kerja\nsama dengan umat\nberagama lain.","6.1 Menuliskan refleksi\ntentang kekhasan\nagama-agama dan\nkepercayaan lain di\nIndonesia\n\n6.2 Menuliskan sebuah\nrefleksi tentang\ndialog antarumat\nberagama dan aliran\nkepercayaan lain di\nIndonesia\n\n6.3 Menuliskan\nsebuah refleksi\ntentang pentingnya\nmembangun\npersaudaraan sejati\nmelalui kerja sama\nantarumat beragama\n","5","5","","0000-00-00 00:00:00","rudi","0000-00-00 00:00:00","3","3","3","3","3","3","3","3","3","3","3","3","","","","","","","","","","","",""),
  ("A03","Pendidikan Agama Kristen  dan Budi Pekerti","Kelompok A (Umum)","0","75","75","Memahami, menerapkan, menganalisis pengetahuan faktual sehingga menumbuhkan pribadi yang terus bertumbuh menjadi dewasa dan berhikmat dalam Kristus","Mengaplikasikan ciri-ciri pribadi yang terus bertumbuh menjadi dewasa sehingga memaknai nilai-nilai kristiani dalam hidupnya","4","4","75","75","Mengaplikasikan kebersamaan tanpa kehilangan identitas dengan peran Roh Kudus dalam membaharui kehidupan orang percaya pada Kristus ","Mengaplikasikan kesaksian tentang peran Roh Kudus dalam kehidupan melalui setia dalam membaca Alkitab dan berdoa sebagai bukti Roh Kudus berperan","4","4","75","75","Mampu mengaplikasikan nilai -nilai kehidupan sebagai keluarga Kristen dengan dalam menghadapi gaya hidup modern","Mampu mengaplikasi peran Allah dalam kehidupan keluarga dengan menunjukkan nilai-nilai Kristiani , untuk menghadapi gaya hidup modern","2","2","75","75","Pentingnya nilai-nilai kristiani dalam kehidupan keluarga yang mengenal Kristus ,untuk menghadapi gaya hidup modern dan mampu menganalisis peran keluarga,sekolah serta mengindentifikasi IPTEK yang mengacu pada Alkitab","Berperan aktif mewujudkan nilai-nilai Kristen dalam menghadapi gaya hidup modern sehingga mampu merefleksi peran keluarga sebagai lembaga pendidikan , serta mampu membuat karya, mengkritisi perkembagan kebudayaan, dan IPTEK mengacu  pada Alkitab","4","4","75","75","Mampu memahami, menerapkan, menganalisis dan mengevaluasi pengetahuan faktual, konseptual, prosedural, dan metakognitif berdasarkan rasa ingin tahunya tentang ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dengan wawasan kemanusiaan, kebangsaan, kenegaraan, dan peradaban terkait penyebab fenomena dan kejadian, serta menerapkan pengetahuan prosedural pada bidang kajian yang spesifik sesuai dengan bakat dan minatnya untuk memecahkan masalah sehingga menghasilkan buah dalam Kristus.","Mengolah, menalar, menyaji, dan mencipta dalam ranah konkret dan ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah secara mandiri serta bertindak secara efektif dan kreatif, dan mampu menggunakan metoda sesuai kaidah keilmuan sebagaimana pemberian kepandaian dari Kristus sehingga menjadi berkat dalam dunia","4","4","75","75","Memahami, menerapkan, menganalisis dan mengevaluasi pengetahuan faktual, konseptual, prosedural, dan metakognitif berdasarkan rasa ingin tahunya tentang ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dengan wawasan kemanusiaan, kebangsaan, kenegaraan, dan peradaban terkait penyebab fenomena dan kejadian, serta menerapkan pengetahuan prosedural pada bidang kajian yang spesifik sesuai dengan bakat dan minatnya untuk memecahkan masalah yang secara khusus pemberian dari Yesus Kristus sehingga siswa dapat memuliakan nama Yesus","Mengolah, menalar, menyaji, dan mencipta dalam ranah konkret dan ranah abstrak terkait dengan pengembangan dari yang dipelajarinya di sekolah secara mandiri serta bertindak secara efektif dan kreatif, dan mampu menggunakan metoda sesuai kaidah keilmuan,serta ","2","2","","0000-00-00 00:00:00","","0000-00-00 00:00:00","4","4","2","4","4","2","4","4","2","4","4","2","","","","","","","","","","","",""),
  ("A04","Pendidikan Agama Hindu  dan Budi Pekerti","Kelompok A (Umum)","0","75","75","Mampu menerapkan Yoga Asanas menurut Susastra Hindu, memahami hakekat Yaja yang terkandung dalam Mahabharata, serta memahami pengetahuan konseptual bahwa Moksha sebagai tujuan akhir menurut agama Hindu.","Terampil dalam menyajikan Yoga Asanas dalam kehidupan sehari-hari, menyajikan pelaksanaan Yaja menurut Mahabharata dalam kehidupan, dan menalar Moksha sebagai tujuan akhir menurut agama Hindu.","1","1","75","75","mampu Memahami kitab suci Veda sebagai sumber hukum Hindu","Terampil dalam menyajikan contoh-contoh kitab Veda Sruti dan Veda Smerti sebagai sumber hukum Hindu","1","1","75","75","Mampu menerapkan Yoga Asanas menurut Susastra Hindu, memahami hakekat Yaja yang terkandung dalam Mahabharata, serta memahami pengetahuan konseptual bahwa Moksha sebagai tujuan akhir menurut agama Hindu.","Terampil dalam menyajikan Yoga Asanas dalam kehidupan sehari-hari, menyajikan pelaksanaan Yaja menurut Mahabharata dalam kehidupan, dan menalar Moksha sebagai tujuan akhir menurut agama Hindu.","1","1","75","75","Mampu memahami esensi Bhakti sejati dalam Ramayana, dan menerapkan perilaku bertanggung jawab untuk menciptakan keluarga Sukhinah.","Terampil dalam menyajikan esensi Bhakti sejati dalam Ramayana, dan menyajikan perilaku bertanggung jawab untuk menciptakan keluarga Sukhinah.","2","2","75","75","memahami kebudayaan pra sejarah dan sejarah agama hindu serta tantra, yantra dan mantra sebagai dasar pokok  keimanan.","melaksanakan dan melestarikan kebudayaan hindu dan mengamalkan tantra, yantra dan mantra sebagai dasar pokok  keimanan.","3","2","75","75","Mampu Mengenal ajaran Catur Marga Yoga dalam agama Hindu","Mampu menerapkan ajaran Catur Marga Yoga sebagai jalan mencapai kesempurnaan hidup","1","1","","0000-00-00 00:00:00","astuti","0000-00-00 00:00:00","1","1","1","1","3","1","1","1","1","1","2","1","","","","","","","","","","","",""),
