  ("A07","Pendidikan Pancasila dan Kewarganegaraan","Kelompok A (Umum)","0","75","75","Nilai-nilai Pancasila dalam kerangka praktik penyelenggaraan pemerintahan negara; Menelaah ketentuan UUD RI Tahun 1945 yang mengatur tentang warga negara, penduduk, agama dan kepercayaan terhadap Tuhan YME, wilayah negara dan Hankam; Menganalisis fungsi dan kewenangan lembaga negara menurut UUD1945; Menganalisis hubungan pemerintah pusat dan daerah menurut UUD 1945.","Menunjukkan nilai-nilai Pancasila dlam kerangka Praktik Penyelenggaraan negara; mempresentasikan hasil telaah tentang ketentuan UUD 1945 yang mengatur tentang wrga negara, penduduk, agama dan kepercayaan terhadap Tuhan YME, wilayah negara dan hankam; Mempresentasikan hasil analis tentang fungsi dan kewenangan lembaga-lembaga negara menurut UUD 1945; melakukan penelitian sederhana tentang hubungan pemerintah pusat dan pemerintah daerah setempat menurut UUD 1945.","4","4","75","75","Memahami sistem hukum dan peradilan nasional, Menganalisis kasus pelanggaran hak dan kewajiban sebagai warganegara; Menganalisis indikator ancaman disintegrasi nasional dan Memahami pentingnya kesadaran berbangsa dan bernegara dilihat dari konteks sejarah dan geopolitik Indonesia.","Menyaji hasil telaah Memahami sistem hukum dan peradilan nasional, Menganalisis kasus pelanggaran hak dan kewajiban sebagai warganegara; Menganalisis indikator ancaman disintegrasi nasional dan Memahami pentingnya kesadaran berbangsa dan bernegara dilihat dari konteks sejarah dan geopolitik Indonesia.","3","3","75","75","Memahami, menerapkan, konseptual, prosedural berdasarkan rasa ingin tahu tentang ilmu pengetahuan, teknologi, seni, budaya, dan humaniora dengan wawasan kemanusiaan, kebangsaan, kenegaraan, menerapkan pengetahuan prosedural pada bidang kajian yang spesifik.","Mengolah, menalar, dan menyaji dalam ranah konkret&amp;ranah abstrak terkait dengan pengembangan dari yang dipelajari; Menyaji hasil kajian pasal-pasal yang mengatur wilayah negara, warga n