ida","0000-00-00 00:00:00","2","2","3","3","2","2","2","2","3","3","2","2","Memahami, menerapkan, dan menganalisis pengetahuan, konseptual, prosedural, dan metakognitif berdasarkan rasa ingin tahunya tentang iptek, seni budaya dan humaniora dengan wawasan kemanusiaan, kebangsaan, kenegaraan, dan peradaban terkait penyebab fenomena dan kejadian, serta menerapkan pengetahuan prosedural pada bidang kajian yang spesifik sesuai dgn bakat dan minatnya untuk memecahkan masalah.","Memahami sistem hukum dan peradilan nasional, Menganalisis kasus pelanggaran hak dan kewajiban sebagai warganegara","Memahami hasil kajian pasal-pasal yang mengatur tentang wilayah negara.","Menganalisis kasus pelanggaran hak dan pengingkaran kewajiban sebagai warga negara","Cukup mampu memahami Hak azasi manusi ","Cukup mampu mengontraskan nilai positif dan negatif IPTEK terhadap negara dalam bingkai Bhineka Tunggal Ika","Mengolah menalar,dan menyaji dalam ranah konkret dan ranah abstrak terkait dengan pengembangan dsri yang dipelajarinya di sekolah secara mandiri,bertindak secara efektif dan kreatif,serta mampu menggunakan metode sesuai kaidah keilmuan.","Menyaji hasil telaah Memahami sistem hukum dan peradilan nasional","Menalar hasil kajian pasal-pasal yang mengatur tentang wilayah negara.","Menyaji  hasil analisis kasus pelanggaran hak","Cukup terampil mencontohkan hak dan kewajiban sebagai seorang siswa .","Mengontraskan nilai positif dan negatif IPTEK terhadap negara dalam bingkai Bhineka Tunggal Ika"),
  ("A08","Bahasa Indonesia","Kelompok A (Umum)","0","75","75","Memahami, mendeskripsikan, menganalisis, dan mengevaluasi teks laporan hasil observasi, eksposisi, dan  anekdot sesuai dengan struktur dan kaidah.","Menyajikan isi, mengonstruksikan, mengembangkan isi, mencipta dan menceritakan kembali teks laporan hasil observasi, eksposisi, dan  anekdot sesuai dengan struktur dan kaidah.","4","4","75","75","Mengidentifikasi, menganalisis, dan mengevaluasi teks negosiasi, teks debat, teks biografi, dan unsur pembangun puisi sesuai dengan struktur dan kaidah teks baik secara lisan maupun tulisan. ","Menginterpretasi, mengembangkan isi, dan menceritakan kembali teks negosiasi, teks debat, teks biografi, dan unsur pembangun puisi sesuai dengan struktur dan kaidah teks baik secara lisan maupun tulisan.","3","3","75","75","Memahami, membandingkan, menganalisis, mengevaluasi teks prosedur kompleks, eksplanasi, ceramah, buku nonfiksi dan buku fiksi sesuai dengan struktur &amp; kaidah kebahasaan.","Menginterpretasi, memproduksi, menyunting, mengabstraksi, mengonversi teks prosedur kompleks, eksplanasi, ceramah, buku nonfiksi &amp; buku fiksi sesuai dengan struktur dan kaidah kebahasaan.","4","4","75","75","Memahami, membandingkan, menganalisis, serta mengevaluasi proposal, karya ilmiah dan ulasan film/drama sesuai dengan struktur dan kaidah kebahasaannya.","Menginterpretasi, memproduksi, menyunting, mengabstraksi, serta mengonversi proposal, karya ilmiah dan ulasan film/drama dengan struktur dan kaidah kebahasaannya.","4","4","75","75","Mendeskripsikan dan menganalisis isi, struktur, dan  unsur kebahasaan surat lamaran pekerjaan, teks cerita sejarah, teks novel sesuai bidang pekerjaan.","Menyeleksi, merancang, dan menyajikan simpulan sistematika surat lamaran pekerjaan, teks cerita sejarah dan teks novel sesuai bidang pekerjaan baik secara lisan maupun tulisan. ","4","4","75","75","Membandingkan dan menganalisis kritik sastra dan esai dari aspek sistematika, kebahasaan, pengetahuan dan pandangan penulis.","Menyusun kritik dan esai dengan memerhatikan aspek sistematika, kebahasaan, pengetahuan dan pandangan penulis.\n","2","2","","0000-00-00 00:00:00","khawa","0000-00-00 00:00:00","2","2","2","2","2","2","2","2","2","2","2","2","Memahami dan mendeskripsikan teks laporan hasil observasi, teks eksposisi, dan teks anekdot.","Memahami dan mendeskripsikan teks negosiasi, teks debat, teks biografi, dan teks puisi.","Memahami dan  membandingkan teks prosedur.","Memahami dan membandingkan teks ulasan.","Mendeskripsikan isi surat lamaran pekerjaan.","Memahami dan membandingkan esai yang dibaca.","Menceritakan kembali teks laporan hasil observasi, teks eksposisi, dan teks anekdot sesuai dengan kemamapuan.","Menceritakan kembali  teks negosiasi, teks debat, teks biografi, dan teks puisi.","Memproduksi teks prosedur sesuai kemampuan.","Memproduksi teks ulasan. ","membuat surat lamaran pekerjaan.","Menyampaikan esai yang telah dibaca."),
  ("A10","Sejarah Indonesia","Kelompok A (Umum)","0","75","75","Memahami konsep dasar sejarah dan menganalisis kehidupan masyarakat Indonesia mulai dari zaman pra aksara hingga proklamasi kemerdekaan dan pembentukan pemerintahan pertama.","Menyajikan hasil pemahaman tentang konsep dasar sejarah dan  kehidupan masyarakat Indonesia mulai dari zaman pra aksara hingga proklamasi kemerdekaan dan pembentukan pemerintahan pertama dalam bentuk tertulis.","4","4","75","75","Menganalisis kehidupan politik dan ekonomi Bangsa Indonesia sejak peristiwa proklamasi (pembentukan pemerintahan pertama RI) sampai dengan awal reformasi (termasuk peran mahasiswa) sekaligus menganalisis strategi dan bentuk perjuangan bangsa Indonesia dalam upaya mempertahankan kemerdekaan. Kemudian peran bangsa Indonesia dalam perdamaian dunia dan dalam mengembangkan IPTEK.","Menyajikan hasil telaah kehidupan politik dan ekonomi Bangsa Indonesia sejak peristiwa proklamasi (pembentukan pemerintahan pertama RI) sampai dengan awal reformasi (termasuk peran mahasiswa), strategi dan bentuk perjuangan bangsa Indonesia dalam upaya mempertahankan kemerdekaan. Kemudian peran bangsa Indonesia dalam perdamaian dunia dan dalam mengembangkan IPTEK.","4","4","75","75","Menganalisis  perubahan, dan keberlanjutan  dalam peristiwa sejarah pada masa penjajahan asing hingga proklamasi kemerdekaan Indonesia,proses masuk dan perkembangan penjajahan bangsa Barat ( Portugis, Belanda dan Inggris ) di Indonesia.\nMenganalisis strategi perlawanan bangsa Indonesia terhadap penjajahan bangsa Barat di Indonesia sebelum dan sesudah abad ke-20 danpersamaan dan perbedaan  pendekatan dan strategi pergerakan nasional di Indonesia pada masa awal kebangkitan nasional,  Sumpah Pemuda dan sesudahnya sampai dengan  Proklamasi Kemerdekaan.\nMenganalisis peran tokoh-tokoh Nasional dan Daerah dalam perjuangan menegakkan negara Republik Indonesia,dampak  politik, budaya, sosial-ekonomi dan pendidikan pada masa penjajahan Barat dalam kehidupan bangsa Indonesia masa kini.","Mengolah informasi tentang peristiwa sejarah pada masa penjajahan Bangsa Barat berdasarkan konsep perubahan dan keberlanjutan, dan menyajikannya dalam bentuk cerita sejarah dan Mengolah informasi tentang proses masuk dan perkembangan penjajahan Bangsa Barat di Indonesia dan menyajikannya dalam bentuk  cerita sejarah.\nMengolah informasi tentang strategi perlawanan bangsa Indonesia terhadap penjajahan Bangsa Barat di Indonesia sebelum dan sesudah abad ke-20 dan menyajikannya dalam bentuk cerita sejarah dan 4.4	Mengolah informasi tentang persamaan dan perbedaan  pendekatan dan strategi pergerakan nasional di Indonesia pada masa awal kebangkitan nasional, pada masa Sumpah Pemuda,  masa  sesudahnya sampai dengan Proklamasi Kemerdekaan dan menyajikannya dalam bentuk cerita sejarah.\nMenulis sejarah tentang  satu tokoh nasional dan tokoh dari daerahnya yang berjuang melawan penjajahan kolonial Barat dan 4.6	Menalar dampak  politik, budaya, sosial-ekonomi dan pendidikan pada masa penjajahan Barat dalam kehidupan bangsa Indonesia masa kini dan menyajikannya dalam bentuk cerita sejarah.\n\n\n\n","3","3","75","75","Menganalisis  peristiwa proklamasi kemerdekaan  dan maknanya bagi kehidupan sosial, budaya, ekonomi, politik, dan pendidikan bangsa Indonesia.\nMenganalisis  peristiwa pembentukan pemerintahan pertama Republik Indonesia dan maknanya bagi kehidupan kebangsaan Indonesia masa kini.\nMenganalisis peran Bung Karno dan Bung Hatta sebagai proklamator serta tokoh-tokoh proklamasi lainnya .\n\n\n","Menalar peristiwa proklamasi kemerdekaan  dan maknanya bagi kehidupan sosial, budaya, ekonomi, politik, dan pendidikan bangsa Indonesia dan menyajikannya dalam bentuk cerita sejarah.\nMenalar peristiwa pembentukan pemerintahan pertama Republik Indonesia dan maknanya bagi kehidupan kebangsaan Indonesia masa kini dan menyajikannya dalam bentuk cerita sejarah.\nMenulis sejarah tentang perjuangan  Bung Karno dan Bung Hatta  \n\n","3","3","75","75","Menganalisis upaya bangsa Indonesia dalam menghadapi ancaman disintegrasi bangsa, menganalisis perkembangan kehidupan politik dan ekonomi pada masa awal kemerdekaan sampai pada masa awal reformasi serta Mengevaluasi peran dan nilai-nilai perjuangan tokoh nasional dan daerah dalam mempertahankan keutuhan negara dan bangsa Indonesia pada masa 1945-1965.","Merekonstruksi ke dalam bentuk cerita sejarah mengenai upaya bangsa Indonesia dalam menghadapi ancaman disintegrasi bangsa, perkembangan kehidupan politik dan ekonomi bangsa Indonesia pada masa awal kemerdekaan sampai pada masa awal Reformasi serta Menuliskan peran dan nilai-nilai perjuangan tokoh nasional dan daerah yang berjuang mempertahankan keutuhan negara dan bangsa Indonesia pada masa 1945-1965 dalam bentuk laporan tertulis.","3","3","75","75","Mengevaluasi  kontribusi  bangsa Indonesia dalam perdamaian dunia diantaranya ; ASEAN, Non Blok dan Misi Garuda.demokrasi Indonesia dari tahun 1950 sampai dengan era Reformasi. \nMengevaluasi  perubahan demokrasi Indonesia dari tahun 1950 sampai dengan era Reformasi. "," Menyajikan hasil telaah tentang kontribusi  bangsa Indonesia dalamperdamaian dunia diantaranya ; ASEAN, Non  Blok, dan Misi Garuda serta menyajikannya dalam bentuk laporan  tertulis. \nMembuat  studi komparasi tentang ide dan gagasan perubahan demokrasi Indonesia 1950 sampai dengan era Reformasi dalam bentuk laporan tertulis.","2","2","","0000-00-00 00:00:00","ameliaresi","0000-00-00 00:00:00","2","2","3","3","3","2","2","2","3","3","3","2","Memahami konsep dasar sejarah ","Memahami kehidupan bangsa Indonesia pasca proklamasi kemerdekaan.","","","","","Menyajikan hasil pemahaman tentang konsep dasar sejarah ","Menyajikan hasil pemahaman tentang kehidupan bangsa Indonesia pasca proklamasi kemerdekaan.","","","",""),
