a wisata. Memahami usaha sarana wisata. Menjelaskan publisitas pariwisata.","","","","","Mengelompokkan industri pariwisata. Mengklasifikasikan motivasi tujuan perjalanan, karakteristik wisatawan berdasarkan usia, jenis kelamin.Menyebutkan solusi tentang dampak industri pariwisata.Mengelompokkan jenjang karir dalam organisasi kepariwisataan. Mengklasifikasikan organisasi kepariwisataan (nasional, regional dan internasional)","Mengklasifikasikan daya tarik wisata. Menyebutkan syarat pembuatan dokumen perjalanan (paspor).Menyebutkan contoh usaha jasa wisata. Menyebutkan contoh usaha sarana wisata. Menyebutkan  contoh publisitas pariwisata.","","","",""),
